import React from "react";
import { NavLink, Outlet, useNavigate } from "react-router-dom";
import { FaSearch, FaCheckDouble } from "react-icons/fa";
import { BsSearch, BsThreeDotsVertical } from "react-icons/bs";

function Pages() {
  return (
    <div className="bg-[#111B21] w-full h-screen grid grid-rows-5 border-r border-gray-600">
      {/* Profile */}
      <section className="w-full bg-[#111B21] row-span-1 grid grid-rows-2 ">
        <div className="flex justify-between bg-[#222E35] p-4 items-center">
          <div className="flex space-x-5">
            <div className="bg-white rounded-full w-10 h-10"></div>
            <div className="text-gray-400 flex flex-col">
              <p className="text-md text-white">Person</p>
              <p className="text-sm">Online</p>
            </div>
          </div>
          <div>
            <button><BsSearch/></button>
            <button><BsThreeDotsVertical/></button>
          </div>
        </div>
        {/* Search */}
        <div className="bg-[#111B21] p-2 py-2 flex flex-row justify-between space-x-6 h-fit" />
      </section>
    </div>
  );
}

export default Pages;
